package com.mypack.ness;

public class Father {

	String name;
	int age;
	public Father() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Father(String name, int age) {
		super();
		this.name = name;
		this.age = age;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public int getAge() {
		return age;
	}
	public void setAge(int age) {
		this.age = age;
	}
	
}
